'use strict';

(function () {
    window.customConfirm = customConfirm;
    window.C2 = customConfirm;

    var template;
    var showing = false;

    function customConfirm(config, confirmDialogBoxLabel, callback) {
        if (! arguments.length) {
            throw 'customConfirm: No arguments were passed';
        }

        if (typeof config === 'function') {
            callback = config;
        }

        config = getFinalConfig(config , confirmDialogBoxLabel);

        if (config.targets) {
            var limit = config.targets.length;
    
            if (limit > 0) {
                var dialog = new Dialog(config, callback);
    
                for (var i = 0; i < limit; i++) {
                    setupEvents(config.targets[i], dialog);
                }
            }
        } else {
            var dialog = new Dialog(config, callback);
            dialog.show();
        }
    }

    function Dialog(settings, callback) {

        let _this = this;
        let modal = getTemplate();

        let title = modal.querySelector('.dialog-title');
        let close = modal.querySelector('.dialog-btn-close');
        let yes = modal.querySelector('.dialog-btn-yes');
        let no = modal.querySelector('.dialog-btn-no');
        let body = modal.querySelector('.dialog-body');

        title.innerHTML = settings.title;
        body.innerHTML = settings.body;
        close.innerHTML = settings.btn_close;
        yes.innerHTML = settings.btn_yes;
        no.innerHTML = settings.btn_no;

        close.addEventListener('click', cancel);
        no.addEventListener('click', cancel);
        yes.addEventListener('click', confirm);

        if (settings.has_overlay) {

            let overlay = document.createElement('DIV');
            modal.appendChild(overlay);
            overlay.className = 'dialog-overlay';
            overlay.addEventListener('click', cancel);

        }

        function cancel(event) {
            event.preventDefault();
            _this.hide();

            if (typeof callback === 'function') {
                callback(false, _this.context);
            }

            _this.setContext(undefined);
        }

        function confirm(event) {
            event.preventDefault();
            _this.hide();

            if (typeof callback === 'function') {
                callback(true, _this.context);
            }

            _this.setContext(undefined);
        }

        _this.modal = modal;
    }

    Dialog.prototype.setContext = function (context) {
        this.context = context;
    };

    Dialog.prototype.show = function () {
        if (showing) {
            $warn('CustomConfir: There\'s already a confirm showing');
            return;
        }
        
        showing = true;
        document.body.appendChild(this.modal);
    };

    Dialog.prototype.hide = function () {
        showing = false;
        this.modal.remove();
    };

    function getFinalConfig(config, confirmDialogBoxLabel) {
        let _defaults = {
            title: confirmDialogBoxLabel.title,
            body: confirmDialogBoxLabel.body,
            btn_yes: confirmDialogBoxLabel.accept,
            btn_no: confirmDialogBoxLabel.decline,
            btn_close: '',
            has_overlay: true
        };

        if (typeof config === 'string') {
            _defaults.targets = config;
        } else if (typeof config === 'object') {
            Object.assign(_defaults, config)
        }

        if (typeof _defaults.targets === 'string') {
            _defaults.targets = document.querySelectorAll(_defaults.targets);
        } else if (typeof _defaults.targets === 'object' && ! _defaults.targets.length) {
            _defaults.targets = [_defaults.targets];
        }

        return _defaults;
    }

    function setupEvents(el, dialog) {
        el.addEventListener('click', function (event) {
            event.preventDefault();
            dialog.setContext(el);
            dialog.show();
        }, false);
    }

    function getTemplate() {
        if (! template) {
            template = document.createElement('DIV');
            template.className = 'dialog';
            template.innerHTML = `<div class="dialog-content">
                <header class="dialog-header"> 
                    <h3 class="dialog-title"></h3> 
                    <img src="${siteUrlJs}assets/icons/close.png" alt="Close" class="dialog-btn-close" />
                </header>
            <div class="dialog-body"></div>
            <footer class="dialog-footer">
                <button class="dialog-btn-no"></button>
                <button class="dialog-btn-yes"></button>
            </footer>`;
        }

        return template.cloneNode(true);
    }

    function $warn() {
        if (typeof window.console === 'object' && typeof console.warn === 'function') {
            console.warn.apply(console, arguments);
        }
    }

})();


