// set value into inputs
const setInputsInfo = ( fields ) => {

    Object.keys(fields).map( (item, i) => {
        $(`#${item.replace('_','-')}`).val(fields[item]);
    });

    return 1;
}

// get form input values
const getInputsInfo = ( fields ) => {

    let data = {}; 
    let is_any_error = 0;

    const formatInputType = {

        'none' : 'item.value.trim()',
        'firstletter' : 'capitalFirstLetter(item.value).trim()',
        'lowercase' : 'item.value.toLowerCase().trim()',
        'uppercase' : 'item.value.toUpperCase().trim()'

    }
    fields.map( (item, i) => {

        const itemInputName = item.name;

        const formatInputRequired = $(`#${itemInputName}`).data('formatinput');

        if( typeof formatInputRequired !== 'undefined'){
            if( formatInputType.hasOwnProperty( formatInputRequired ) ){
                data[ itemInputName.replace('-', '_') ] = (item.value) ? eval(formatInputType[ formatInputRequired ]) : '';
            }else{
                is_any_error = 1;
            }
        }else{
            is_any_error = 1;
        }

      
    });

    if( is_any_error === 0){
        return data;
    }else{
        return 1;
    }
    
    
}

